'''Liliwen''' is an [[Elves|Elven]] [[Group of Advanced Gardeners|farmer]] living in the Elven village of [[Lletya]]. She watches over the [[Lletya]] [[fruit tree]] patch. In exchange for a range of possible [[disease (Farming)|payments]], she will watch over players' crops and prevent them from dying, eliminating the need for regular monitoring of the patch.

==Shop==
Liliwen also sells basic farming tools, which can be accessed by talking to her and asking ''Can you sell me something?'' It is not an actual shop and it has no set stock; each item must be bought individually through the dialogue.
